<script lang="ts" setup>
    import { reactive, ref,getCurrentInstance } from 'vue';
    import { FormInstance, FormRules } from 'element-plus';
    import dsauth from '@dscloud/api/dsauth';
    import util from '@dscloud/utils/util';
    import router from '@dscloud/router';
    import store from '@dscloud/store';
    import {DsSliderVerifyForm} from '@dscloud/components';
    import JSEncrypt from 'jsencrypt';
    //当前实例
    const pwdFormRef = ref<FormInstance>();
    const codeFormRef = ref<FormInstance>();
    const verfiyFormPwd = ref();
    const data = reactive({
        verifyVisiblePwd:false,
        loginType:'form',
        userName: "",
        userPwd: "",
        verifyIdPwd:"",//密码登录验证reqid
        phoneNumber:"",
        verifyIdCode:"",//验证码登录验证reqid
        authCode:"",
        submitLoading:false,
        errorInfo:false
    });
    const formRules = reactive<FormRules>({
        userName: [{required: true, message: "请输入用户名", trigger: "blur"}],
        userPwd: [{required: true, message: "请输入密码", trigger: "blur"}],
        verifyIdPwd: [{required: true, message: "请点击按钮验证", trigger: "blur"}],
        phoneNumber:[
            {required: true, message: "请输入手机号", trigger: "blur"},
            {type: 'string', pattern: util.validator.regExps.mobile, message: "手机号输入错误", trigger: ['blur', 'change']}
        ],
        authCode:[
            {required: true, message: "请输入验证码", trigger: "blur"},
            {type: 'string', pattern: util.validator.regExps.number,  message:"验证码输入错误", trigger: ['blur', 'change']}
        ],
        verifyIdCode: [{required: true, message: "请点击按钮验证", trigger: "blur"}],
    });

    /**
     * 获取rsa public key
     */
    let publicKey:any = null;
    dsauth.getPublicKey().then((res:any) => {
        if(res) {
            publicKey = res.publicKey;
        }
    });
    //密码登录
    const submitPwd = async (formEl: FormInstance | undefined) => {
        if (!formEl) return;
        await formEl.validate((valid, fields) => {
            if (valid) {
                let jsencrypt = new JSEncrypt()
                jsencrypt.setPublicKey(publicKey);
                console.log(data);
                let params = {
                    username:jsencrypt.encrypt(data.userName),
                    password:jsencrypt.encrypt(data.userPwd),
                    requestId:data.verifyIdPwd
                };
                data.submitLoading=true;
                dsauth.loginPwd(params).then((res:any) => {
                    if(res) {
                        data.verifyVisiblePwd = false;
                        data.errorInfo = false;
                        //
                        store.commit("saveAuthorInfo", res);
                        router.push('/home');
                    }
                }).catch(function (error:any) {
                    if(error&&error.code=="200206"&&error.data>=2) {//密码输错大于两次
                        data.verifyVisiblePwd = true;
                    }
                    if(error&&error.code=="001003"){//登录超时请重试
                        window.setTimeout(function(){
                            window.location.reload();
                        } ,1000);
                    }
                    data.errorInfo = error.description||error;
                    data.submitLoading = false;
                    //刷新验证
                    if(data.verifyVisiblePwd) {
                        debugger;
                        verfiyFormPwd.value.reset();
                    }
                });
            } else {
                console.log('error submit!', fields)
            }
        })
    }
    //验证码登录
    const submitCode = async (formEl: FormInstance | undefined) => {
        if (!formEl) return
        await formEl.validate((valid, fields) => {
            if (valid) {
               /* proxy.$api.login(data).then((res) => {
                    debugger;
                    proxy.$store.commit("saveUserInfo",res);
                    proxy.$router.push('/home');
                });*/
            } else {
                console.log('error submit!', fields)
            }
        })
    }
</script>
